import styled from "styled-components"

const Container = styled.div` 
width:100dvw;
height:100dvh;
background:#fefaf1;
`
const Wrapper = styled.div`
max-width:30%;
`
const Header = styled.div``
const HeaderBgText = styled.p`
  font-size: 2.2rem;
  font-weight: 500;
  text-align: center;
`;
const HeaderSmText = styled.p`
text-align:center;
font-weight:100;
font-size:.85rem;
opacity:.8;
`;

const InputCon = styled.div``
const Input = styled.input`
   width:100%;
`

function ResetPassword() {
  return (
    <Container className="flex aic jcc" >
      <Wrapper className='flex aic jcc fdc' >
        <Header>
         <HeaderBgText>Reset Your Password</HeaderBgText>
         <HeaderSmText>Input your account email and we`ll send an OTP to your Email,To reset your password!.</HeaderSmText>
        </Header>
        <InputCon>
        <Input className="" />
        </InputCon>
      </Wrapper>
    </Container>
  )
}

export default ResetPassword
